import React,{ useState } from "react";
import axios from "axios";
import { useNavigate } from 'react-router-dom';

 
function CreateProducts() {
 
 const [name, setName] = useState("");
 const [price, setPrice] = useState(0);

 const navigate = useNavigate();

 
 
 async function save(event) {
    const token=localStorage.getItem('token');
    axios.interceptors.request.use(
        config=> {
            config.headers.authorization=`Bearer ${token}`;
            return config;
        },
        error=> {
            return Promise.reject(error);
        }

    );
    console.log(token);
    console.log(token);
    console.log(token);

 event.preventDefault();
 try {
 await axios.post("http://localhost:8080/products/save", {
    'name': name,
    'price': price
 }).then((res)=>
 {
    console.log(token);

 });
 alert("Product created Successfully"); 
 } catch (err) {
 alert(err);
 }
 }
 
 return (
    <div>
        <div className="container mt-4">
            <div class="card">
                <h1>Create Product</h1>
            <form>
                <div class="form-group">
                    <label>Product Name</label>
                    <input type="text" class="form-control" id="name" placeholder="Enter Product Name" value={name} onChange={(event)=>{
                        setName(event.target.value);
                    }}
                    />
                </div>
                <div class="form-group">
                    <label>Product Price</label>
                    <input type="text" class="form-control" id="price" placeholder="Enter Product price" value={price} onChange={(event)=>{
                        setPrice(event.target.value);
                    }}
                    />
                </div>
                <button type="submit" class="btn btn-primary mt-4" onClick={save}>Save</button>
            </form>
            </div>
        </div>


    </div>
 );
 }
 
 export default CreateProducts;
